import { Route, Routes } from "react-router-dom";
import './App.css';
import Article from "./pages/article";
import ArticleContents from "./pages/articleContents";
import Home from "./pages/home";
import QandA from "./pages/Q&A";
import Signin from "./pages/Login/signin";
import Signup from "./pages/Register/signup";
import Video from "./pages/video";
import AboutTeam from "./pages/aboutTeam";
import ExpertHome from "./pages/expertPage";
import PostArticle from "./pages/postArticle";
import PostQuestion from "./pages/postQuestion";
import VideoDetail from "./pages/videoDetail";
import UploadFile from "./pages/UploadFile";


function App() {
  return (
    <Routes>
      <Route path="/" element={<Home />} />
      <Route path="/article" element={<Article />} />
      <Route path="/signin" element={<Signin />} />
      <Route path="/signup" element={<Signup />} />
      <Route path='/video' element={<Video />} />
      <Route path="/video/detail" element={<VideoDetail />} />
      <Route path="/article/:id" element={<ArticleContents />} />
      <Route path="/QandA" element={<QandA />} />
      <Route path="/QandA/post" element={<PostQuestion />} />
      <Route path="/aboutTeam" element={<AboutTeam />} />
      <Route path="/expert/home" element={<ExpertHome />} />
      <Route path="/article/post" element={<PostArticle />} />
      <Route path="/video/upload" element={<UploadFile />} />
    </Routes>
  );
}

export default App;
